// PhaseManagement.js
import React, { useState, useEffect } from "react";
import axios from "axios";

const PhaseManagement = () => {
  const [phases, setPhases] = useState([]);
  const [form, setForm] = useState({ id: null, phaseName    : "", description: "", status: "ACTIVE" });
  const [isEdit, setIsEdit] = useState(false);
  const [error, setError] = useState("");
  const [message, setMessage] = useState("");

  const fetchPhases = async () => {
    try {
      const res = await axios.get("http://localhost:8080/api/phases");
      setPhases(res.data);
    } catch {
      setError("Failed to load phases.");
    }
  };

  useEffect(() => {
    fetchPhases();
  }, []);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    if (!form.name.trim()) return setError("Phase name is required.");

    try {
      if (isEdit) {
        await axios.put(`http://localhost:8080/api/phases/${form.id}`, form);
        setMessage("Phase updated successfully.");
      } else {
        await axios.post("http://localhost:8080/api/phases", form);
        setMessage("Phase added successfully.");
      }
      setForm({ id: null, name: "", description: "", status: "Active" });
      setIsEdit(false);
      fetchPhases();
    } catch (err) {
      setError("Failed to save phase. Possibly a duplicate name.");
    }
  };

  const handleEdit = (phase) => {
    setForm(phase);
    setIsEdit(true);
  };

  const handleDelete = async (id) => {
    if (!window.confirm("Are you sure you want to delete this phase?")) return;
    try {
      await axios.delete(`http://localhost:8080/api/phases/${id}`);
      fetchPhases();
    } catch {
      setError("Cannot delete phase in use.");
    }
  };

  return (
    <div className="max-w-4xl mx-auto p-4">
      <h2 className="text-xl font-bold mb-4">Phase Management</h2>
      {error && <p className="text-red-500">{error}</p>}
      {message && <p className="text-green-500">{message}</p>}

      <form onSubmit={handleSubmit} className="space-y-4 bg-gray-100 p-4 rounded shadow">
        <input name="name" value={form.phaseName} onChange={handleChange} placeholder="Phase Name" className="w-full border p-2 rounded" required />
        <textarea name="description" value={form.description} onChange={handleChange} placeholder="Description" className="w-full border p-2 rounded" />
        <select name="status" value={form.status} onChange={handleChange} className="w-full border p-2 rounded">
          <option>ACTIVE</option>
          <option>INACTIVE</option>
        </select>
        <div className="flex gap-2">
          <button type="submit" className="bg-indigo-600 text-white px-4 py-2 rounded">{isEdit ? "Update" : "Add"}</button>
          {isEdit && <button onClick={() => { setForm({ id: null, name: "", description: "", status: "Active" }); setIsEdit(false); }} className="bg-gray-400 text-white px-4 py-2 rounded">Cancel</button>}
        </div>
      </form>

      <table className="mt-6 w-full border">
        <thead className="bg-gray-200">
          <tr>
            <th className="p-2 text-left">Name</th>
            <th className="p-2 text-left">Description</th>
            <th className="p-2 text-left">Status</th>
            <th className="p-2">Actions</th>
          </tr>
        </thead>
        <tbody>
          {phases.map((phase) => (
            <tr key={phase.id} className="border-t">
              <td className="p-2">{phase.phaseName}</td>
              <td className="p-2">{phase.description}</td>
              <td className="p-2">{phase.status}</td>
              <td className="p-2 flex gap-2">
                <button onClick={() => handleEdit(phase)} className="text-blue-500">Edit</button>
                <button onClick={() => handleDelete(phase.id)} className="text-red-500">Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default PhaseManagement;
